import React from 'react';
import MyPageListData from './MyPageListData';
import './MyPageList.scss';

class MyPageList extends React.Component {
    constructor(props){
        super(props);
        this.state = {
            data: ""
        }
    }

    render() {
        return(
            <div id="MyPageList" >
                <MyPageListData data = {this.props.data}/>
            </div>
        )
    }
}
export default MyPageList;
